import React from 'react'
import Button from './Button'

const ButtonList = () => {

const arr = ["Search" , "TV" , "Games" , "Comedy" , "Drama" , "Fun" , "Movie" , "Dance" , "Cookiong" , "Coding" ]



  return (
    <div className='flex mx-2 overflow-y-auto'>
      { arr.map((item , index)=>{
        return<Button  name = {item} key={index} />
       })}
    </div>
  )
}

export default ButtonList
